const SkeletonLoad = () => {
  return (
    <div className="skeletonWrapper">
      <div className="skeletonData">
        {/* <Skeleton type="title" /> */}
        <Skeleton type="avatar" />
        <Skeleton type="text" />

        {/* <Skeleton type="thumbnail" /> */}
        {/* <Skeleton type="avatar" /> */}
      </div>
      <Skeleton type="text" />
